function downloadRegistratonFormPDF(id, rooturl) {
    var urlValue = rooturl + "GetRegistratonForm?id=" + id;
    var docDefinition = {
        footer: function (currentPage, pageCount) {
            return {
                columns: [
                    moment().format('MMMM Do YYYY, h:mm:ss a'),
                    {
                        alignment: 'right',
                        text: [
                            { text: currentPage.toString(), italics: true },
                            ' of ',
                            { text: pageCount.toString(), italics: true }
                        ]
                    }
                ],
                margin: [10, 0]
            };
        },
        header: function (currentPage, pageCount, pageSize) {
            // you can apply any logic and return any valid pdfmake element

            return [
                { text: '', alignment: 'center', margin: 10 },
                //{ canvas: [{ type: 'rect', x: 170, y: 32, w: pageSize.width - 170, h: 40 }] }
            ]
        },
        // a string or { width: number, height: number }
        pageSize: 'A4',

        // by default we use portrait, you can change it to landscape if you wish
        pageOrientation: 'portrait',
        content: [
          {//0
              image: 'atsLogo',
              "fontSize": 10,
              fit: [300, 80],
              alignment: "center",
              margin: [10, 50, 0, 0],
          },
          {//1
              text: "Swim Lesson Registration Form",
              alignment: "center",
              "fontSize": 16,
              bold: true,
              color: "#990000",
              margin: 15,
          },
          {//2
              fontSize: 10,
              margin: [10, 10, 0, 10],
              table: {
                  // headers are automatically repeated if the table spans over multiple pages
                  // you can declare how many rows should be treated as headers
                  headerRows: 0,
                  dontBreakRows: true,
                  widths: ['*', 100, 100, 150],
                  lineHeight: 2.5,
                  body: [
                      //0
                      [{ text: 'Mother/Guardian Name: {mname}', lineHeight: 1.5, colSpan: 3 }, {}, {}, { text: 'Date: {date}' }],
                      //1
                      [{ text: 'Father/Guardian Name: {fname}', lineHeight: 1.5, colSpan: 3 }, {}, {}, { text: '{ref}' }],
                      //2
                      [{ text: 'Address: {addr}', lineHeight: 1.5, colSpan: 4 }, {}, {}, {}],
                      //3
                      [{ text: 'City: {city}', lineHeight: 1.5, colSpan: 2 }, {}, { text: 'State: {state}', colSpan: 2 }, {}],
                      //4
                      [{ text: 'Primary Phone: {pphone}', lineHeight: 1.5, colSpan: 2 }, {}, { text: 'Alternate Phone: {aphone}', colSpan: 2 }, {}],
                      //5
                      [{ text: 'Email Address: {email}', lineHeight: 1.5, colSpan: 4 }, {}, {}, {}],
                      //6
                      [{ columns: [{ image: 'checked', fit: [16, 16], width: 20 }, { text: "New Customer" }], border: [true, true, false, true] }, { columns: [{ image: 'unchecked', fit: [16, 16], width: 20 }, { text: "Returning Customer" }], border: [false, true, true, true] }, { text: 'If new, how did you find about us?\nReferral:\n{referral}', colSpan: 2, lineheight: 1.5 }, {}],
                  ]
              },
          },
          {//3
              text: "Please note: 10 Rials to be paid for registration fees for every child. You will receive discount of 10 Rial on lesson fees from second child onwards.",
              alignment: "left",
              "fontSize": 10,
              margin: 10,
          },
        ],
        images: {
            atsLogo: 'data:image/jpeg;base64,',
            unchecked: 'data:image/jpeg;base64,',
            checked: 'data:image/png;base64,'
        }
    }

    $.ajax({
        async: true,
        type: "GET",
        cache: false,
        url: urlValue,
    }).done(
        function (data, textStatus, jqXHR) {
            docDefinition.content[2].table.body[0][0].text = docDefinition.content[2].table.body[0][0].text.replace("{mname}", data.MotherName);
            docDefinition.content[2].table.body[0][3].text = docDefinition.content[2].table.body[0][3].text.replace("{date}", data.Date);
            docDefinition.content[2].table.body[1][0].text = docDefinition.content[2].table.body[1][0].text.replace("{fname}", data.FatherName);
            docDefinition.content[2].table.body[1][3].text = docDefinition.content[2].table.body[1][3].text.replace("{ref}", data.Reference);
            docDefinition.content[2].table.body[2][0].text = docDefinition.content[2].table.body[2][0].text.replace("{addr}", data.Address);
            docDefinition.content[2].table.body[3][0].text = docDefinition.content[2].table.body[3][0].text.replace("{city}", data.City);
            docDefinition.content[2].table.body[3][2].text = docDefinition.content[2].table.body[3][2].text.replace("{state}", data.Region);
            docDefinition.content[2].table.body[4][0].text = docDefinition.content[2].table.body[4][0].text.replace("{pphone}", data.PrimaryPhone);
            docDefinition.content[2].table.body[4][2].text = docDefinition.content[2].table.body[4][2].text.replace("{aphone}", data.AlternatePhone);
            docDefinition.content[2].table.body[5][0].text = docDefinition.content[2].table.body[5][0].text.replace("{email}", data.EmailAddress);
            docDefinition.content[2].table.body[6][2].text = docDefinition.content[2].table.body[6][2].text.replace("{referral}", data.Referral);

            for (var o in data.ChildrenSummary) {
                docDefinition.content.push(getChildTitle(parseInt(o) + 1));
                docDefinition.content.push(getChildInfo(data.ChildrenSummary[o]));
            }

            docDefinition.content.push(getFormTotal(data.RegrTotal, data.PlanTotal, data.DiscountTotal, data.Total));

            pdfMake.createPdf(docDefinition).download(data.Reference + " Registration Form.pdf");
        }
    );
};

function getChildTitle(sno) {
    var element = {
        text: "Child #{sno} Information",
        "fontSize": 10,
        bold: true,
        margin: [10, 10, 0, 0],
    };
    element.text = element.text.replace("{sno}", sno.toString());
    return element;
}

function getChildInfo(child) {
    var element = {
        fontSize: 10,
        margin: [10, 10, 0, 10],
        table: {
            headerRows: 0,
            dontBreakRows: true,
            widths: [150, 50, 150, 50, '*'],

            body: [
                [{ text: "Child Name: {name}", lineHeight: 1.5, colSpan: 2 }, {}, { text: 'DOB: {dob}' }, { text: 'Gender: {gender}' }, { text: 'Age: {age}' }],
                [{ text: "Selected Plan: {plan}", lineHeight: 1.5, colSpan: 3 }, {}, {}, { text: 'Cost per month: {cost}', colSpan: 2 }, {}],
                [{ text: "Past\nExperience: {pe}", lineHeight: 1.25 }, { text: 'Preferred\nDay(s): {pd}', colSpan: 2 }, {}, { text: 'Preferred\nTime(s): {pt}', colSpan: 2 }, {}],
            ]
        }
    };
    element.table.body[0][0].text = element.table.body[0][0].text.replace("{name}", child.Name);
    element.table.body[0][2].text = element.table.body[0][2].text.replace("{dob}", child.DOB);
    element.table.body[0][3].text = element.table.body[0][3].text.replace("{gender}", child.GenderDisplay);
    element.table.body[0][4].text = element.table.body[0][4].text.replace("{age}", child.Age);

    element.table.body[1][0].text = element.table.body[1][0].text.replace("{plan}", child.AquaTotsPlanName);
    element.table.body[1][3].text = element.table.body[1][3].text.replace("{cost}", child.CostString);

    element.table.body[2][0].text = element.table.body[2][0].text.replace("{pe}", child.PastExperience);
    element.table.body[2][1].text = element.table.body[2][1].text.replace("{pd}", child.PreferredDaysDisplay);
    element.table.body[2][3].text = element.table.body[2][3].text.replace("{pt}", child.PreferredTimeDisplay);

    return element;
}

function getFormTotal(rt, pt, dt, tt) {
    var element = {
        fontSize: 10,
        margin: [10, 10, 0, 10],
        table: {
            headerRows: 0,
            dontBreakRows: true,
            widths: [150, '*'],

            body: [
                [{ text: "Registration Fees", lineHeight: 1.5 }, { text: '' }],
                [{ text: "Lesson Cost Per Month", lineHeight: 1.5 }, { text: '' }],
                [{ text: "Total Discount", lineHeight: 1.5 }, { text: '' }],
                [{ text: "Total", lineHeight: 1.5 }, { text: '' }]
            ]
        }
    };

    element.table.body[0][1].text = rt;
    element.table.body[1][1].text = pt;
    element.table.body[2][1].text = dt;
    element.table.body[3][1].text = tt;
    return element;
}